('osclass', 'market_products_version', '{\"date\":\"2024-08-21 14:59:02\",\"data\":{\"last_update\":\"2024-08-21 01:00:00\",\"0yNxpeRQtrJ1P40QfCn1\":{\"s_product_key\":\"0yNxpeRQtrJ1P40QfCn1\",\"s_version\":\"3.8.6\",\"fk_i_item_id\":\"46\",\"s_osc_version_from\":\"3.3\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-08-19 12:52:19\",\"s_comment\":\"Integrated new payment gateway MakeCommerce.com\"},\"MTZ9Tv7cVAPLzMfIOupg\":{\"s_product_key\":\"MTZ9Tv7cVAPLzMfIOupg\",\"s_version\":\"3.3.9\",\"fk_i_item_id\":\"47\",\"s_osc_version_from\":\"3.0\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-01-15 14:21:28\",\"s_comment\":\"Fixed error notices in backoffice.\"},\"KHrh5ixSocGe8COBeMc7\":{\"s_product_key\":\"KHrh5ixSocGe8COBeMc7\",\"s_version\":\"1.3.1\",\"fk_i_item_id\":\"48\",\"s_osc_version_from\":\"3.3\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-08-15 14:47:36\",\"s_comment\":\"Improvements to identify uploaded image.\"},\"LacliCEGw3BAf1JlcNdU\":{\"s_product_key\":\"LacliCEGw3BAf1JlcNdU\",\"s_version\":\"1.5.5\",\"fk_i_item_id\":\"49\",\"s_osc_version_from\":\"3.3\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-08-05 13:20:09\",\"s_comment\":\"Minor fixes for PHP 8.3.\"},\"CNMxiwkWshE8H3F1JyMo\":{\"s_product_key\":\"CNMxiwkWshE8H3F1JyMo\",\"s_version\":\"2.4.2\",\"fk_i_item_id\":\"50\",\"s_osc_version_from\":\"3.0\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-03-01 09:23:43\",\"s_comment\":\"Design improvements in user account.\\nSmall fixes.\"},\"ac52YupMpzkKcAtcCy8m\":{\"s_product_key\":\"ac52YupMpzkKcAtcCy8m\",\"s_version\":\"3.3.4\",\"fk_i_item_id\":\"51\",\"s_osc_version_from\":\"3.0\",\"s_osc_version_to\":\"\",\"last_update_date\":\"2024-03-23 17:20:15\",\"s_comment\":\"It is now possible to use bot protect when multiple forms at same page.\"},\"2mdX3OOMOsFdKnYHx4Cp\":{\"s_product_key\":\"2mdX3OOMOsFdKnYHx4Cp\",\"s_version\":\"1.1.1\",\"fk_i_item_id\":\"52\",\"s_osc_version_from\":\"3.0\",\"s_osc_version_to\":\"\",\